import gql from 'graphql-tag';

//Query para el discograf

export const songs_query = gql ` query {
    getSongs {
        id
        titulo
        album
        artista
        img
        urlsong
        duracion
    }
}`

export const song_query = gql ` query {
    getSong(id:"5d55e064b772702bb80996a1"){
        id
        urlsong
        titulo
        artista
        album
        img
        duracion
    }
}`
